let state = {
  posts: [
    { id: 1, text: "Hey, im here!", likescount: 20 },
    { id: 2, text: "Hello world!", likescount: 10 },
    { id: 3, text: "Hello!", likescount: 10 },
    { id: 4, text: "world!", likescount: 10 },
  ],
  messages: [
    { id: 1, text: "Hi!" },
    { id: 2, text: "Yo!" },
    { id: 3, text: "Lol!" },
    { id: 4, text: "Kek" },
    { id: 5, text: "Chevurek!" },
  ],
  dialogs: [
    { id: 1, name: "Alex" },
    { id: 2, name: "Vasya" },
    { id: 3, name: "Petya" },
    { id: 4, name: "Kolya" },
    { id: 5, name: "Ivan" },
  ],
  links: [
    {id: 1, href:'/Profile', name:'Profile', icon:'face'},
    {id: 2, href:'/Dialogs', name:'Dialogs', icon:''},
    {id: 3, href:'/Audio', name:'Audio', icon:''}
  ],
  logo: ['Logo'],
};

export default state;
